const TaskList = ({status}) => {
	let title = '';
	switch(status) {
		case 'backlog':
			title = 'Backlog';
			break;
		case 'in-process':
			title = 'In process';
			break;
		case 'ready':
			title = 'Ready';
			break;
		case 'remove':
			title = 'Remove';
			break;
	}
	return (
		<section className={`tasks tasks--${status}`}>
      <h3 className="tasks__title">{title}</h3>
			<ul className="tasks__list">
				<li className="tasks__item">First Task <button className="btn--edit"></button></li>
			</ul>
		</section>
	)
}

export default TaskList;
